import React, { useState } from 'react';
import Layout from '../components/Layout';

function CreateProjectPage() {
  const [title, setTitle] = useState('');
  const [author, setAuthor] = useState('');
  const [contact, setContact] = useState('');
  const [semester, setSemester] = useState('');
  const [description, setDescription] = useState('');
  const [tags, setTags] = useState([]);
  const [githubLink, setGithubLink] = useState('');
  const [websiteLink, setWebsiteLink] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // 构建待提交的project对象
    const newProject = {
      title,
      author,
      contact,
      semester,
      description,
      tags,
      githubLink,
      websiteLink,
    };

    // 在此处调用API进行创建请求
    console.log('New Project:', newProject);
  };

  const handleTagsChange = (e) => {
    // 按逗号或回车分割tags
    const input = e.target.value;
    // 假设使用逗号分隔tags，也可根据需求更改逻辑
    const splitted = input.split(',').map(tag => tag.trim()).filter(Boolean);
    setTags(splitted);
  };

  return (
    <Layout>
      <div className="max-w-2xl mx-auto mt-10 bg-white shadow-md rounded-lg p-6">
        <h1 className="text-2xl font-bold mb-6 text-blue-700">Create a New Project</h1>
        <form onSubmit={handleSubmit} className="flex flex-col gap-4">
          <div>
            <label className="block text-gray-700 font-semibold mb-1">Title</label>
            <input 
              type="text" 
              value={title}
              onChange={e => setTitle(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2"
              placeholder="Enter project title"
            />
          </div>

          <div>
            <label className="block text-gray-700 font-semibold mb-1">Author</label>
            <input 
              type="text" 
              value={author}
              onChange={e => setAuthor(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2"
              placeholder="Enter author name"
            />
          </div>

          <div>
            <label className="block text-gray-700 font-semibold mb-1">Contact (email or phone)</label>
            <input 
              type="text" 
              value={contact}
              onChange={e => setContact(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2"
              placeholder="Enter contact info"
            />
          </div>

          <div>
            <label className="block text-gray-700 font-semibold mb-1">Semester</label>
            <input 
              type="text" 
              value={semester}
              onChange={e => setSemester(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2"
              placeholder="e.g. Fall 2024"
            />
          </div>

          <div>
            <label className="block text-gray-700 font-semibold mb-1">Description</label>
            <textarea 
              value={description}
              onChange={e => setDescription(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2 h-24"
              placeholder="Enter project description"
            />
          </div>

          <div>
            <label className="block text-gray-700 font-semibold mb-1">Tags (comma separated)</label>
            <input 
              type="text"
              onChange={handleTagsChange}
              className="w-full border border-gray-300 rounded px-3 py-2"
              placeholder="e.g. JavaScript, HTML, CSS"
            />
            {tags.length > 0 && (
              <div className="flex flex-wrap gap-2 mt-2">
                {tags.map((tag, index) => (
                  <span key={index} className="bg-purple-100 text-blue-700 text-xs font-semibold px-3 py-1 rounded-full">
                    {tag}
                  </span>
                ))}
              </div>
            )}
          </div>

          <div>
            <label className="block text-gray-700 font-semibold mb-1">Github Link</label>
            <input 
              type="text"
              value={githubLink}
              onChange={e => setGithubLink(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2"
              placeholder="https://github.com/username/repo"
            />
          </div>

          <div>
            <label className="block text-gray-700 font-semibold mb-1">Website Link</label>
            <input 
              type="text"
              value={websiteLink}
              onChange={e => setWebsiteLink(e.target.value)}
              className="w-full border border-gray-300 rounded px-3 py-2"
              placeholder="https://example.com"
            />
          </div>

          <div className="mt-4">
            <button 
              type="submit"
              className="bg-purple-600 text-white px-4 py-2 rounded hover:bg-purple-700 transition-colors"
            >
              Submit
            </button>
          </div>
        </form>
      </div>
    </Layout>
  );
}

export default CreateProjectPage;
